            id: 1,
            features: 'Grill'
        },
        {
            id: 1,
            features: 'Cable Tv'
        },
        {
            id: 1,
            features: 'Air Conditioning'
        },
        {
            id: 1,
            features: 'Coffee Pot'
        },
        {
            id: 1,
            features: 'Balcony'
        },
        {
            id: 1,
            features: 'Computer'
        },
        {
            id: 1,
            features: 'Parquet'
        },
        {
            id: 1,
            features: 'Internet'
        },
